import * as jsPDF from "jspdf";
(function(jsPDFAPI) {
  var font =
    "";
  var callAddFont = function() {
    this.addFileToVFS("CormorantGaramond-normal.ttf", font);
    this.addFont("CormorantGaramond-normal.ttf", "CormorantGaramond", "normal");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
